// Helper function to decompress ranges back to individual levels
export function decompressLevelingOrder(compressedOrder) {
  const levelingArray = [];
  for (const [skill, count] of compressedOrder) {
    for (let i = 0; i < count; i++) {
      levelingArray.push(skill);
    }
  }
  return levelingArray;
}
